import song1 from './Music/LazyDay.mp3';
import song2 from './Music/LoveSong.mp3';
import song3 from './Music/Beatbox.mp3';
import song4 from './Music/song4.mp3';

export default [
    ["Live & Love", "Sara J.", song2],
    ["Lazy Song", "Lim", song1],
    ["Beatbox", "Jones Jill", song3],
    ["Bad Days", "Ultra Nova", song4],
    ["Rest Of Our life", "Yagi"],
    ["That Friend.", "Laura T."],
    ["Great Mess", "Hank Pops"],
];
